DROP TABLE IF EXISTS `b001__users`;
$$

CREATE TABLE `b001__users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `createdat` datetime(3) DEFAULT NULL,
  `updatedat` datetime(3) DEFAULT NULL,
  `deletedat` datetime(3) DEFAULT NULL,
  `username` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  `isactive` tinyint(1) DEFAULT NULL,
  `failcount` bigint(20) DEFAULT NULL,
  `lastlogin` datetime(3) DEFAULT NULL,
  `roleid` bigint(20) unsigned NOT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `surname` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `countryid` bigint(20) unsigned NOT NULL,
  `cityid` bigint(20) unsigned DEFAULT NULL,
  `phone` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` tinyint(3) unsigned DEFAULT NULL,
  `dateofbirth` datetime(3) DEFAULT NULL,
  `avatarid` bigint(20) unsigned DEFAULT NULL,
  `stateid` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_user_username` (`username`),
  KEY `idx_User_RoleID` (`roleid`),
  KEY `idx_user_deletedat` (`deletedat`)
) ENGINE=InnoDB AUTO_INCREMENT=10001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
$$


